import {useState, useEffect } from 'react';

function App() {
    const [tracks, setTracks] = useState([]);

    return (
        <div className="App">
            <header>
                <h1>LDR MUSIC LIBRARY</h1>
                <h2>What would you like to do?</h2>
            </header>

            <nav className="navbar">
                    <ul className="links">
                        <li>Show all songs</li>
                        <li>Search & edit</li>
                        <li>Add new</li>
                    </ul>
            </nav>
        </div>
    );
}

export default App;
